/* WARNING: Script requires that SQLITE_DBCONFIG_DEFENSIVE be disabled */
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE checkpoint_commands (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  command TEXT NOT NULL,
  description TEXT,
  arguments TEXT,  -- JSON array: [{"args": "state", "description": "Shows cluster state"}]
  category TEXT,
  version TEXT,
  keywords TEXT,
  mode TEXT,  -- clish, expert
  type TEXT,  -- config, query
  device TEXT,  -- firewall, management
  executable_mcp BOOLEAN DEFAULT 0,
  impact TEXT,  -- low, medium, high, critical
  related_commands TEXT,  -- JSON array of IDs: [1, 5, 12]
  deprecated BOOLEAN DEFAULT 0,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE command_embeddings (
  command_id INTEGER PRIMARY KEY,
  embedding BLOB NOT NULL,
  FOREIGN KEY (command_id) REFERENCES checkpoint_commands(id) ON DELETE CASCADE
);
PRAGMA writable_schema=ON;
  command,
  description,
  keywords,
  category,
  content=''checkpoint_commands'',
  content_rowid=''id''
)');
CREATE TABLE IF NOT EXISTS 'commands_fts_data'(id INTEGER PRIMARY KEY, block BLOB);
CREATE TABLE IF NOT EXISTS 'commands_fts_idx'(segid, term, pgno, PRIMARY KEY(segid, term)) WITHOUT ROWID;
CREATE TABLE IF NOT EXISTS 'commands_fts_docsize'(id INTEGER PRIMARY KEY, sz BLOB);
CREATE TABLE IF NOT EXISTS 'commands_fts_config'(k PRIMARY KEY, v) WITHOUT ROWID;
DELETE FROM sqlite_sequence;
CREATE INDEX idx_category ON checkpoint_commands(category);
CREATE INDEX idx_mode ON checkpoint_commands(mode);
CREATE INDEX idx_device ON checkpoint_commands(device);
CREATE INDEX idx_executable_mcp ON checkpoint_commands(executable_mcp);
CREATE INDEX idx_deprecated ON checkpoint_commands(deprecated);
CREATE TRIGGER commands_ai AFTER INSERT ON checkpoint_commands BEGIN
  VALUES (new.id, new.command, new.description, new.keywords, new.category);
END;
CREATE TRIGGER commands_ad AFTER DELETE ON checkpoint_commands BEGIN
  DELETE FROM commands_fts WHERE rowid = old.id;
END;
CREATE TRIGGER commands_au AFTER UPDATE ON checkpoint_commands BEGIN
  UPDATE commands_fts 
  SET command = new.command,
      description = new.description,
      keywords = new.keywords,
      category = new.category
  WHERE rowid = new.id;
END;
CREATE TRIGGER update_timestamp AFTER UPDATE ON checkpoint_commands BEGIN
  UPDATE checkpoint_commands SET updated_at = CURRENT_TIMESTAMP WHERE id = NEW.id;
END;
PRAGMA writable_schema=OFF;
COMMIT;
