INSERT INTO checkpoint_commands VALUES(2,'cphaprob','Herramienta principal de monitoreo y diagnóstico de ClusterXL en CheckPoint. Permite verificar el estado completo del cluster incluyendo miembros activos/standby, critical devices (pnotes), interfaces monitoreadas, sincronización entre nodos, estadísticas de load balancing, historial de failovers, configuración de bonds, latencia entre miembros y estado de encriptación CCP. Es el comando más utilizado para troubleshooting de clusters.','[{"args":"state","description":"Muestra el estado general del cluster incluyendo modo (HA/Load Sharing), ID de cada miembro, dirección única, carga asignada, estado (ACTIVE/STANDBY/DOWN), nombre del miembro, critical devices activos con problemas, último evento de cambio de estado con código y razón, historial de failover y contador de failovers desde el último reinicio"},{"args":"-l list","description":"Lista detallada de todos los critical devices (pnotes) registrados en el cluster mostrando: nombre del dispositivo, número de registro, timeout configurado en segundos, estado actual (OK/problem/init), tiempo desde el último reporte y estado del proceso. Útil para identificar qué componente está causando que un miembro esté DOWN"},{"args":"list","description":"Muestra lista de critical devices con opciones: -l para formato largo con detalles completos, -i para información adicional, -e para formato extendido, -ia para mostrar toda la información disponible"},{"args":"if","description":"Muestra interfaces del cluster con opciones: -a para mostrar todas las interfaces (secured y virtuales), -m para mostrar solo interfaces monitoreadas, -vs <VSID> para especificar un Virtual System, -vs all para todos los VS. Incluye estado de cada interfaz, dirección IP y si está participando activamente en el cluster"},{"args":"syncstat","description":"Muestra estadísticas detalladas de sincronización de conexiones entre miembros del cluster incluyendo: número de paquetes sync enviados/recibidos, bytes transferidos, conexiones sincronizadas, errores de sincronización y estado del canal sync. Usar -reset para reiniciar los contadores. Útil para diagnosticar problemas de sincronización"},{"args":"ldstat","description":"Muestra estadísticas de load balancing en modo Load Sharing (Multicast/Unicast) incluyendo distribución de carga entre miembros, paquetes procesados por cada miembro y balance de conexiones. Usar -reset para reiniciar contadores"},{"args":"show_failover","description":"Muestra historial completo de eventos de failover con: fecha/hora de cada failover, miembro que pasó a ACTIVE, miembro que bajó, razón del failover (ejemplo: ADMIN_DOWN, interface down, pnote problem), código de evento CLUS-XXXXXX. Opciones: -reset para limpiar historial, -c para resetear contador, -h para resetear historial, -l <count> para limitar cantidad de eventos mostrados"},{"args":"names","description":"Muestra cómo se presentan los miembros del cluster en los logs locales: por ID numérico (modo por defecto) o por nombre configurado. Afecta a logs en /var/log/messages, dmesg y $FWDIR/log/fwd.elg"},{"args":"tablestat","description":"Muestra tabla de direcciones IP únicas de todos los miembros del cluster con su estado de monitoreo. Usar -m para mostrar solo direcciones IP monitoreadas. Útil para verificar qué IPs están siendo rastreadas por el mecanismo de cluster"},{"args":"show_bond","description":"Muestra estado detallado de interfaces bond (agregación de enlaces) incluyendo: interfaces subordinadas activas, modo del bond (active-backup, 802.3ad, etc.), interface activa actual, estado de cada subordinada. Si se especifica bond_name muestra solo ese bond, sin argumentos muestra todos"},{"args":"show_bond_groups","description":"Muestra grupos de interfaces bond configurados en el cluster con información sobre qué bonds pertenecen a cada grupo y su configuración de alta disponibilidad"},{"args":"igmp","description":"Muestra configuración de IGMP (Internet Group Management Protocol) utilizada en clusters Load Sharing con modo Multicast, incluyendo grupos multicast suscritos y estado de membresía"},{"args":"routedifcs","description":"Muestra interfaces que el daemon RouteD está monitoreando en el cluster para protocolos de enrutamiento dinámico (OSPF, BGP, RIP). Usar detailed para información extendida incluyendo métricas y estado de cada protocolo"},{"args":"roles","description":"Muestra roles del daemon RouteD en cada miembro del cluster: cuál es el miembro activo para enrutamiento dinámico y cuál está en standby. Importante en clusters HA con protocolos de enrutamiento"},{"args":"release","description":"Muestra la versión exacta de ClusterXL instalada en el miembro actual, incluyendo número de release, build y hotfixes aplicados"},{"args":"ccp_encrypt","description":"Muestra si la encriptación del Cluster Control Protocol (CCP) está activada o desactivada. CCP es el protocolo que usan los miembros para comunicarse sobre estado y sincronización"},{"args":"corr","description":"Muestra estadísticas de corrección del cluster (paquetes que debieron ser reenviados o corregidos). Opciones: -d para deferred packets (paquetes diferidos), -f para forwarded packets (paquetes reenviados a otro miembro), -s para resumen general. Útil para detectar problemas de distribución de tráfico"},{"args":"fcustat","description":"Muestra estadísticas del mecanismo Full Connectivity Upgrade, que permite actualizar clusters sin pérdida de conectividad. Incluye: estado de la actualización, conexiones migradas, paquetes procesados durante upgrade"},{"args":"latency","description":"Muestra latencia de comunicación entre los miembros del cluster en milisegundos. Importante para diagnosticar problemas de red entre nodos que pueden causar split-brain o failovers falsos"}]','clusterxl','R81+','cluster, estado, monitoreo, diagnóstico, high availability, failover, pnotes, critical devices, sincronización, interfaces, bond, estadísticas, load sharing, latencia, troubleshooting, standby, active','expert','query','firewall',1,'low','[]',0,'2025-12-28 21:26:25','2025-12-28 21:26:25');
INSERT INTO checkpoint_commands VALUES(3,'cphaconf','Comando de configuración interna avanzada de ClusterXL en CheckPoint. Permite configurar critical devices (pnotes) personalizados, encriptación del protocolo CCP, modos de operación del cluster, configuración de interfaces bond para load sharing, forwarding layer entre miembros y parámetros del kernel del cluster. ADVERTENCIA: Es un comando de bajo nivel que debe usarse con precaución, preferiblemente solo bajo instrucciones de CheckPoint Support, ya que configuraciones incorrectas pueden afectar la estabilidad del cluster.','[{"args":"set_pnote -d <device> -t <timeout> -s {ok|init|problem} [-p] [-g] register","description":"Registra un critical device (pnote) personalizado en el cluster. El device debe reportar su estado periódicamente dentro del timeout (en segundos) o el miembro será marcado como DOWN. Estado inicial: ok (device funcionando), init (inicializando, miembro DOWN hasta que cambie), problem (falla inmediata, causa failover). Opciones: -p hace el cambio permanente (sobrevive reinicio), -g aplica a todos los Virtual Systems. Límite: 16 pnotes por miembro, nombres máximo 15 caracteres sin espacios"},{"args":"set_pnote -d <device> [-p] [-g] unregister","description":"Des-registra un critical device específico del cluster eliminándolo de la lista de componentes monitoreados. El miembro ya no verificará el estado de este device. Usar -p para cambio permanente, -g para aplicar a todos los Virtual Systems"},{"args":"set_pnote -a [-g] unregister","description":"Des-registra TODOS los critical devices personalizados del cluster de una sola vez. No afecta a los pnotes built-in del sistema. Usar -g para aplicar a todos los Virtual Systems configurados"},{"args":"set_pnote -d <device> -s {ok|init|problem} [-g] report","description":"Reporta o cambia el estado actual de un critical device ya registrado. Estados: ok (device funcionando correctamente), init (device inicializando, cluster no puede ser ACTIVE), problem (device falló, causa DOWN inmediato del miembro y failover). Usar -g para aplicar a todos los Virtual Systems"},{"args":"set_pnote -f <file> [-g] register","description":"Registra múltiples critical devices desde un archivo de configuración. El archivo debe tener formato: cada línea con <nombre> <timeout> <estado>. Útil para configurar varios pnotes simultáneamente. Usar -g para aplicar a todos los Virtual Systems"},{"args":"mem_id_mode {id|name}","description":"Configura cómo se muestran los miembros del cluster en logs locales: id (número de miembro, modo por defecto) o name (nombre configurado en SmartConsole). Afecta logs en /var/log/messages, dmesg y $FWDIR/log/fwd.elg. Debe configurarse igual en todos los miembros del cluster"},{"args":"ccp_encrypt {on|off}","description":"Activa o desactiva la encriptación del Cluster Control Protocol (CCP). CCP es el protocolo de comunicación entre miembros para intercambiar información de estado, sincronización y heartbeats. La encriptación protege esta comunicación sensible. Debe configurarse igual en todos los miembros"},{"args":"ccp_encrypt_key <key_string>","description":"Configura la clave de encriptación compartida para el Cluster Control Protocol (CCP). Todos los miembros del cluster deben usar la misma clave para poder comunicarse. Solo funciona si ccp_encrypt está en on"},{"args":"forward {on|off}","description":"Configura el Cluster Forwarding Layer que controla el reenvío de tráfico entre miembros del cluster. NOTA: Esta es una función interna de CheckPoint y solo debe modificarse bajo instrucción directa del soporte técnico. Configuración incorrecta puede causar pérdida de tráfico"},{"args":"bond_ls set <bond> <value>","description":"Configura el número mínimo de interfaces subordinadas requeridas activas en un bond para Load Sharing. Por defecto es n-1 (si hay 4 subordinadas, requiere mínimo 3). Si caen más interfaces de las permitidas, el bond se considera DOWN. Calcular según: (tráfico_máximo_esperado / velocidad_subordinada) redondeado arriba. Se guarda en $FWDIR/conf/cpha_bond_ls_config.conf"},{"args":"bond_ls remove <bond>","description":"Elimina la configuración personalizada de número mínimo de interfaces subordinadas para un bond específico, volviendo al comportamiento por defecto (n-1 interfaces requeridas)"},{"args":"debug_data","description":"Imprime la configuración completa actual del cluster tal como está cargada en el kernel del firewall. Útil para debugging avanzado y verificación de configuración a nivel de kernel. Muestra parámetros internos, interfaces, pnotes y estado del cluster"},{"args":"failover_bond <bond_name>","description":"Inicia manualmente un failover interno entre las interfaces subordinadas de un bond específico. Solo aplicable en modo Bond High Availability. Fuerza el cambio de la interface subordinada activa a otra disponible. Útil para testing o mantenimiento de interfaces"},{"args":"mvc {on|off}","description":"Activa o desactiva el mecanismo Multi-Version Cluster (MVC) que permite ejecutar un cluster con miembros en diferentes versiones de CheckPoint durante actualizaciones. Cuando está off, los miembros con versión más nueva quedan en estado READY hasta que todos tengan la misma versión. Debe configurarse igual en todos los miembros"}]','clusterxl','R81+','configuración, cluster, critical device, pnote, encriptación, ccp, bond, load sharing, administración avanzada, kernel, forwarding, multi-version cluster','expert','config','firewall',0,'high','[]',0,'2025-12-28 21:27:21','2025-12-28 21:27:21');
INSERT INTO checkpoint_commands VALUES(4,'clusterXL_admin','Comando para iniciar manualmente failover del cluster poniendo un miembro en modo administrativo DOWN o UP. Permite realizar mantenimiento programado sin afectar el servicio, ejecutar testing de failover controlado o troubleshooting de problemas de cluster. El comando manipula el critical device especial admin_down que tiene prioridad sobre otros pnotes. En clusters HA causa transición inmediata de ACTIVE a STANDBY forzando al otro miembro a tomar control. En Load Sharing redistribuye el tráfico a los demás miembros activos.','[{"args":"down","description":"Pone el miembro local del cluster en estado DOWN administrativamente de forma temporal (no sobrevive reinicio). Esto activa el critical device admin_down, fuerza un failover inmediato al miembro standby en HA o redistribuye tráfico en Load Sharing. El miembro deja de procesar tráfico pero mantiene sincronización. Útil para mantenimiento programado, testing de failover o troubleshooting. Para hacer permanente usar -p o en Clish: set cluster member admin down permanent"},{"args":"down -p","description":"Pone el miembro local en estado DOWN administrativamente de forma permanente (sobrevive reinicio). El miembro permanecerá DOWN incluso después de reiniciar hasta que se ejecute clusterXL_admin up. Ideal para mantenimiento prolongado donde se requieren múltiples reinicios del servidor"},{"args":"up","description":"Restaura el miembro local a operación normal desde estado DOWN administrativo de forma temporal. Desactiva el critical device admin_down permitiendo que el miembro vuelva a participar en el cluster. En HA pasará a STANDBY si ya hay otro ACTIVE. En Load Sharing volverá a recibir tráfico. Si hay otro miembro ACTIVE, no fuerza failover"},{"args":"up -p","description":"Restaura el miembro a operación normal de forma permanente (sobrevive reinicio). Elimina el estado DOWN administrativo persistente configurado previamente con down -p. El miembro volverá a participar activamente en el cluster y mantendrá este estado tras reinicios"}]','clusterxl','R81+','failover manual, mantenimiento, down, up, cluster administration, high availability, standby, active, testing, troubleshooting, admin_down','expert','config','firewall',1,'critical','[]',0,'2025-12-28 21:28:01','2025-12-28 21:28:01');
INSERT INTO checkpoint_commands VALUES(5,'set cluster member','Comandos de configuración de ClusterXL desde Gaia Clish (interfaz de línea de comandos de Gaia). Permite configurar aspectos fundamentales del cluster sin necesidad de entrar a Expert mode, incluyendo: iniciar failover manual, configurar encriptación de comunicaciones CCP, establecer modo de visualización de miembros en logs, activar Multi-Version Cluster y controlar el forwarding layer. Estos comandos son equivalentes a los comandos cphaconf y clusterXL_admin de Expert mode pero diseñados para uso en el shell seguro de Gaia. Los cambios deben aplicarse consistentemente en todos los miembros del cluster.','[{"args":"admin {down|up} [permanent]","description":"Inicia failover manual del cluster desde Gaia Clish poniendo el miembro en DOWN (causa failover inmediato al standby) o UP (restaura operación normal). Equivalente a clusterXL_admin en Expert mode. Usar permanent para que el cambio sobreviva reinicios. En HA fuerza transición ACTIVE/STANDBY, en Load Sharing redistribuye tráfico. Útil para mantenimiento programado sin afectar servicio"},{"args":"ccpenc {off|on}","description":"Activa (on) o desactiva (off) la encriptación del Cluster Control Protocol (CCP) desde Gaia Clish. CCP es el protocolo de comunicación interna entre miembros del cluster para heartbeats, sincronización de estado y coordinación de failover. Encriptar CCP protege información sensible del cluster. Debe configurarse idénticamente en todos los miembros para mantener comunicación. Equivalente a cphaconf ccp_encrypt en Expert mode"},{"args":"forwarding {off|on}","description":"Activa (on) o desactiva (off) el Cluster Forwarding Layer que controla cómo se reenvía tráfico entre miembros. ADVERTENCIA: Función interna de CheckPoint que solo debe modificarse bajo instrucción del soporte técnico. Configuración incorrecta puede causar pérdida total de tráfico o loops. Equivalente a cphaconf forward en Expert mode"},{"args":"idmode {id|name}","description":"Configura cómo se muestran los miembros del cluster en logs locales: id muestra el número de miembro (1, 2, 3..., modo por defecto), name muestra el nombre configurado en SmartConsole (Member1, Member2...). Afecta logs en /var/log/messages, dmesg y $FWDIR/log/fwd.elg. Facilita identificación en troubleshooting. Debe configurarse igual en todos los miembros. Equivalente a cphaconf mem_id_mode en Expert mode"},{"args":"mvc {off|on}","description":"Activa (on) o desactiva (off) el mecanismo Multi-Version Cluster que permite ejecutar cluster con miembros en diferentes versiones de CheckPoint durante actualizaciones. Con mvc off, miembros con versión superior quedan en estado READY hasta que todos estén en la misma versión. Con mvc on, versiones mixtas pueden coexistir permitiendo upgrades sin downtime. Debe configurarse igual en todos los miembros. Equivalente a cphaconf mvc en Expert mode"}]','clusterxl','R81+','clish, gaia, configuración cluster, failover, encriptación ccp, multi-version, logs, administración, set cluster','clish','config','firewall',0,'high','[]',0,'2025-12-28 21:28:49','2025-12-28 21:28:49');
INSERT INTO checkpoint_commands VALUES(6,'show cluster','Comandos de monitoreo y visualización de ClusterXL desde Gaia Clish (interfaz de línea de comandos de Gaia). Proporciona visibilidad completa del estado y operación del cluster sin necesidad de entrar a Expert mode. Permite verificar: estado de miembros (ACTIVE/STANDBY/DOWN), critical devices y causas de fallas, interfaces monitoreadas y su estado, estadísticas de sincronización y failover, configuración de bonds, versiones instaladas, encriptación CCP, roles de enrutamiento y historial de eventos. Son equivalentes a los comandos cphaprob de Expert mode pero diseñados para uso en el shell seguro de Gaia. Herramienta principal para troubleshooting y monitoreo operacional del cluster.','[{"args":"state","description":"Muestra el estado general del cluster desde Gaia Clish: modo de operación (HA/Load Sharing), lista de todos los miembros con su ID, dirección IP única, carga asignada, estado actual (ACTIVE/STANDBY/DOWN/READY), nombre, critical devices con problemas, último evento de cambio de estado, historial de failover y contadores. Equivalente a cphaprob state en Expert mode. Comando principal para verificar salud del cluster"},{"args":"members pnotes","description":"Lista todos los critical devices (pnotes) registrados en el cluster mostrando: nombre del device, número de registro, timeout configurado, estado actual (OK/problem/init), tiempo desde último reporte. Incluye pnotes built-in (fwd, cphad, Policy, Fullsync, etc.) y personalizados. Equivalente a cphaprob -l list en Expert mode. Esencial para diagnosticar por qué un miembro está DOWN"},{"args":"members interfaces","description":"Muestra todas las interfaces del cluster con su estado, dirección IP, tipo (secured/virtual), y si están siendo monitoreadas por ClusterXL. Incluye interfaces físicas, VLANs y bonds. Indica cuáles participan activamente en detección de fallas. Equivalente a cphaprob if en Expert mode"},{"args":"members ips","description":"Muestra tabla de direcciones IP únicas de todos los miembros del cluster con su estado de monitoreo. Útil para verificar qué direcciones IP están siendo rastreadas por el mecanismo de high availability. Equivalente a cphaprob tablestat en Expert mode"},{"args":"members sync","description":"Muestra estadísticas detalladas de sincronización de conexiones entre miembros: paquetes sync enviados/recibidos, bytes transferidos, conexiones sincronizadas, errores, estado del canal de sincronización. Usar ''reset'' para reiniciar contadores. Equivalente a cphaprob syncstat. Crítico para diagnosticar problemas de pérdida de conexiones durante failover"},{"args":"members failover","description":"Muestra historial completo de eventos de failover del cluster: fecha/hora exacta, transición entre miembros (quién pasó a ACTIVE), razón del failover (ADMIN_DOWN, interface down, pnote problem, etc.), código de evento CLUS-XXXXXX. Equivalente a cphaprob show_failover. Esencial para auditoría y análisis de estabilidad"},{"args":"members statistics","description":"Muestra estadísticas generales de operación del cluster incluyendo: contadores de paquetes procesados, distribución de carga, eventos de failover, tiempo de actividad de cada miembro, performance del cluster. Vista consolidada de métricas operacionales"},{"args":"members idmode","description":"Muestra el modo actual de presentación de miembros en logs locales: ID (números 1,2,3...) o NAME (nombres configurados). Afecta /var/log/messages, dmesg y logs de firewall. Equivalente a cphaprob names en Expert mode"},{"args":"members ccpenc","description":"Muestra el estado de encriptación del Cluster Control Protocol (CCP): ON si las comunicaciones entre miembros están encriptadas, OFF si van en claro. CCP transporta heartbeats, estado y sincronización. Equivalente a cphaprob ccp_encrypt en Expert mode"},{"args":"members mvc","description":"Muestra el estado del mecanismo Multi-Version Cluster (MVC): ON si está permitido ejecutar cluster con versiones mixtas de CheckPoint durante upgrades, OFF si requiere misma versión en todos los miembros. Incluye versiones actuales de cada miembro"},{"args":"members release","description":"Muestra la versión exacta de ClusterXL instalada en cada miembro del cluster incluyendo: número de release (R81, R81.10, R81.20), build number, hotfixes aplicados. Útil para verificar consistencia de versiones. Equivalente a cphaprob release"},{"args":"members igmp","description":"Muestra configuración IGMP (Internet Group Management Protocol) del cluster para modo Load Sharing Multicast: grupos multicast suscritos, direcciones multicast en uso, estado de membresía IGMP. Solo relevante en clusters Load Sharing con multicast. Equivalente a cphaprob igmp"},{"args":"members roles","description":"Muestra roles del daemon RouteD (enrutamiento dinámico) en cada miembro: cuál está activo procesando OSPF/BGP/RIP y cuál en standby. Importante en clusters HA con protocolos de enrutamiento dinámico. Equivalente a cphaprob roles"},{"args":"bond all","description":"Muestra estado completo de todas las interfaces bond (agregación de enlaces) configuradas en el cluster: interfaces subordinadas, cuáles están activas, modo del bond (active-backup, LACP 802.3ad, balance-rr, etc.), interface primaria actual, estado de cada subordinada (up/down). Equivalente a cphaprob show_bond"},{"args":"bond name <bond_name>","description":"Muestra información detallada de una interface bond específica: todas sus interfaces subordinadas, cuál está actualmente activa/primaria, modo de operación del bond, estado individual de cada subordinada, estadísticas de tráfico por subordinada si aplica"},{"args":"members monitored","description":"Muestra solo las interfaces que están siendo activamente monitoreadas por ClusterXL para detección de fallas. Excluye interfaces no-monitored configuradas. Útil para verificar qué interfaces pueden causar failover si fallan"}]','clusterxl','R81+','clish, gaia, monitoreo cluster, show cluster, estado, pnotes, interfaces, failover, sincronización, estadísticas, bond, troubleshooting, high availability','clish','query','firewall',1,'low','[]',0,'2025-12-28 21:30:03','2025-12-28 21:30:03');
INSERT INTO checkpoint_commands VALUES(7,'vsx','Comando principal para gestión y administración de VSX (Virtual System Extension) en CheckPoint. Permite obtener y aplicar configuración desde el Security Management Server, gestionar políticas de seguridad de Virtual Systems y Virtual Routers, controlar recursos de memoria y CPU, mostrar estadísticas y estado del VSX Gateway, resetear SIC, descargar políticas y limpiar entradas no utilizadas. Es la herramienta fundamental para operación y troubleshooting de entornos VSX que soportan múltiples virtual firewalls en un único hardware físico.','[{"args":"fetch","description":"Obtiene la configuración más reciente desde el Security Management Server o Multi-Domain Server y la aplica al VSX Gateway. Lee el archivo local.vsall con los Network Configuration Scripts (NCS) y los ejecuta. Opciones: -v verbose (información detallada), -q quiet (solo resumen), -s concurrent fetch para multi-procesador, -c indica VSX Cluster, -n no aplicar si configuración ya está actualizada, -f <archivo> usar archivo específico en lugar de local.vsall, -C ejecutar comando NCS específico, [<Management Server>] obtener desde servidor específico por hostname o IP"},{"args":"fetch_all_cluster_policies","description":"Obtiene las políticas de seguridad de todos los Virtual Systems y Virtual Routers desde los peers del cluster VSX. Útil para sincronizar políticas entre miembros del cluster después de cambios o para recuperación. Opción: -v para modo verbose con información detallada del proceso de fetch"},{"args":"fetchvs","description":"Obtiene el archivo de configuración para un Virtual Device específico basándose en información almacenada localmente en el VSX Gateway. Permite especificar el VS por VSID (ID numérico) o por nombre del Virtual Device. Opciones: -v verbose para información detallada, -q quiet para solo información resumida. Más rápido que fetch completo cuando solo se necesita actualizar un VS específico"},{"args":"get","description":"Muestra información sobre el contexto VSX actual incluyendo: nombre del VSX Gateway, ID del contexto actual, y si está en contexto de VS0 (gateway principal) o de un Virtual System específico. Útil para confirmar en qué contexto se están ejecutando comandos antes de hacer cambios"},{"args":"mstat","description":"Muestra y configura Memory Resource Control para Virtual Systems. Sin opciones muestra consumo total de memoria por cada VS. Opciones: -vs <VSID> para VSs específicos (uno o varios separados por espacios), unit <MB|GB|%> para unidad de medida, sort <número|all> para ordenar por consumo, enable/disable para activar/desactivar control, status para ver si está activo, swap <minutos> para configurar monitoreo de swap, debug para modo debug. Muestra: Memory Total, Memory Free, Swap Total, Swap Free, Swap-in rate"},{"args":"resctrl","description":"CPU Resource Control - Desde R80.40 está integrado en la utilidad CPView. Para acceder: 1) Cambiar a contexto VS0 con vsenv, 2) Ejecutar cpview, 3) Navegar a Advanced > VSX > VSs > Physical-Resources. Muestra consumo de CPU por Virtual System y Virtual Router. La columna CPU% muestra porcentaje de CPU usado por todos los procesos de cada VS (porcentaje de single CPU como en comando top). Para obtener uso total del VSX Gateway dividir el valor entre número de CPU cores"},{"args":"showncs","description":"Muestra el Network Configuration Script (NCS) para un Virtual Device. El NCS contiene los comandos de configuración de red que se ejecutan cuando se aplica la configuración VSX. Útil para troubleshooting de problemas de configuración de interfaces, VLANs, routing y otros aspectos de red del Virtual Device. Permite ver exactamente qué comandos se ejecutarán sin aplicarlos"},{"args":"sicreset","description":"Resetea Secure Internal Communication (SIC) para el Virtual System o Virtual Router en el contexto VSX actual. SIC es el canal de comunicación cifrada entre el VS/VR y el Security Management Server. Usar cuando hay problemas de comunicación, después de cambios de certificados, o cuando el SMS no puede conectar con el VS. Requiere re-establecer trust en SmartConsole después del reset"},{"args":"stat","description":"Muestra información detallada de estado del VSX Gateway incluyendo: lista de todos los Virtual Systems y Virtual Routers configurados con sus IDs, nombres, tipo (VS/VR), estado (up/down), políticas instaladas, versión de software, interfaces asignadas, uso de recursos, y estado de conectividad con Management Server. Opciones disponibles para filtrar y formatear la salida. Comando principal para overview rápido del estado del VSX"},{"args":"unloadall","description":"Descarga (unload) las políticas de seguridad de todos los Virtual Systems y Virtual Routers del VSX Gateway. Esto detiene el enforcement de políticas en todos los VS/VR pero no los elimina del sistema. ADVERTENCIA: Comando de alto impacto - todo el tráfico será permitido (o bloqueado según configuración por defecto) hasta que se reinstalen las políticas. Útil para troubleshooting o antes de mantenimiento mayor"},{"args":"vspurge","description":"Limpia entradas no utilizadas de Virtual Devices y obtiene archivos de configuración actualizados. Elimina configuraciones de VSs que fueron borrados del Management Server pero cuyas entradas permanecen en local.vskeep del gateway. Ejecuta operación de purge y luego fetch para sincronizar. Útil después de eliminar Virtual Systems para liberar recursos y mantener configuración limpia. Operación segura que solo afecta VSs ya eliminados"}]','vsx','R81+','vsx, virtual system, virtual router, configuración, fetch, policy, memoria, cpu, sic, gateway, multi-tenant, virtualización','expert','query','firewall',1,'medium','[]',0,'2025-12-31 11:44:08','2025-12-31 11:44:08');
INSERT INTO checkpoint_commands VALUES(8,'vsenv','Cambia el contexto del shell actual a un Virtual System o Virtual Device específico en un VSX Gateway. Una vez ejecutado, todos los comandos subsecuentes se ejecutarán en el contexto del Virtual System seleccionado, permitiendo administrar, configurar y troubleshoot ese VS de forma aislada. El prompt del shell cambia para indicar el VSID actual. Es fundamental usar vsenv antes de ejecutar comandos específicos de un VS para evitar hacer cambios en el VS equivocado. Para ver la lista de Virtual Devices disponibles, usar el comando ''vsx stat -v''. En plataformas escalables (Maestro y Chassis) debe ejecutarse en el Security Group apropiado.','[{"args":"(sin argumentos)","description":"Cambia el contexto del shell al Virtual Device 0 (VS0), que es el Virtual System por defecto y representa el VSX Gateway principal. VS0 tiene acceso administrativo completo al VSX Gateway y es el contexto desde donde se gestionan todos los demás Virtual Systems"},{"args":"<VSID>","description":"Cambia el contexto del shell a un Virtual System específico identificado por su ID numérico (VSID). Por ejemplo: vsenv 1, vsenv 2, vsenv 3. Una vez en el contexto de un VS específico, todos los comandos subsecuentes se ejecutarán en ese Virtual System, incluyendo comandos de red, firewall, routing, etc. El prompt cambiará para mostrar el VSID actual"},{"args":"<Nombre Virtual Device>","description":"Cambia el contexto del shell a un Virtual System específico identificado por su nombre configurado en SmartConsole. Por ejemplo: vsenv VS-DMZ, vsenv VS-Internet. Más intuitivo que usar VSID cuando se trabaja con muchos Virtual Systems. El nombre debe coincidir exactamente con el configurado en el Management Server"}]','vsx','R81+','vsx, vsenv, virtual system, contexto, cambiar contexto, vsid, virtual device, administración, multi-tenant','expert','utility','firewall',1,'low','[]',0,'2025-12-31 11:44:31','2025-12-31 11:44:31');
INSERT INTO checkpoint_commands VALUES(9,'vsx_util','Utilidad de mantenimiento y configuración avanzada para VSX ejecutada desde el Management Server (Security Management Server o Multi-Domain Server). Permite realizar tareas de administración del VSX Gateway y VSX Cluster que no están disponibles en SmartConsole, incluyendo: añadir/remover miembros del cluster, cambiar IPs de gestión y redes internas, reemplazar interfaces, convertir entre modos HA y VSLS, actualizar/downgrade versiones en la base de datos, restaurar configuración, y gestionar distribución de Virtual Systems. CRÍTICO: Siempre hacer backup antes de ejecutar (sk100395) y cerrar todos los SmartConsole para evitar database lock errors. Comandos son interactivos y requieren autenticación del Management Server.','[{"args":"add_member","description":"Añade un nuevo miembro a un VSX Cluster existente y envía (push) la configuración completa del cluster al nuevo miembro. Solicita: nombre del VSX Cluster, nombre del nuevo miembro, IP de gestión, IP de sincronización y Activation Key (SIC). Después de añadir el miembro a la base de datos del Management Server, ofrece reconfigurarlo automáticamente. IMPORTANTE: Hacer backup antes de ejecutar y cerrar todos los SmartConsole abiertos para evitar database lock"},{"args":"remove_member","description":"Elimina un miembro de un VSX Cluster. Remueve el miembro de la base de datos del Management Server pero no desinstala el software del hardware físico. Útil para reemplazar hardware dañado o reducir tamaño del cluster. IMPORTANTE: Hacer backup antes de ejecutar y cerrar SmartConsole para evitar database lock"},{"args":"change_interfaces","description":"Reemplaza automáticamente interfaces existentes con nuevas interfaces en todos los Virtual Devices que usan esas interfaces. Solicita qué interfaces reemplazar y con cuáles. Actualiza configuración en todos los VSs/VRs afectados. Útil cuando se cambia hardware de red o se reorganizan interfaces físicas. Requiere nombre del VSX Gateway/Cluster"},{"args":"show_interfaces","description":"Muestra configuración de interfaces seleccionadas incluyendo: tipos de interface, conexiones a Virtual Devices, direcciones IP asignadas, VLANs configuradas. Vista consolidada de cómo están distribuidas las interfaces entre los Virtual Systems. Útil para documentación y troubleshooting de configuración de red"},{"args":"change_mgmt_ip","description":"Cambia la dirección IP de gestión de un VSX Gateway o miembro de VSX Cluster DENTRO DE LA MISMA SUBNET. Solo modifica la IP manteniendo la subnet actual. Actualiza configuración en Management Server y en el gateway. Para cambiar a diferente subnet usar change_mgmt_subnet. Requiere nombre del VSX object y opcionalmente nombre del miembro si es cluster"},{"args":"change_mgmt_subnet","description":"Cambia la dirección IP de gestión de un VSX Gateway o miembro de VSX Cluster a una SUBNET DIFERENTE. Permite cambiar tanto IP como subnet/máscara. Más completo que change_mgmt_ip. Actualiza toda la configuración de red de gestión. También puede añadir IP de gestión si no existía previamente"},{"args":"change_private_net","description":"Cambia la dirección IP de la red de comunicación interna (Internal Communication Network) en un VSX Cluster. Esta red se usa para comunicación entre miembros del cluster. Actualiza IPs de sincronización en todos los miembros del cluster. Requiere nombre del VSX Cluster. Operación crítica que puede afectar comunicación del cluster"},{"args":"convert_cluster","description":"Convierte el modo de operación de un VSX Cluster entre High Availability (HA, modo por defecto) y Virtual System Load Sharing (VSLS). HA: solo un miembro activo a la vez. VSLS: múltiples miembros activos simultáneamente con Virtual Systems distribuidos. ADVERTENCIA: Operación mayor que requiere planificación, puede requerir reinstalación de políticas"},{"args":"upgrade","description":"Actualiza la versión de un VSX Gateway o VSX Cluster en la base de datos del Management Server. NO realiza la actualización de software en el hardware, solo actualiza la metadata en la base de datos para reflejar que el gateway fue actualizado. Ejecutar DESPUÉS de actualizar el software en el gateway físico. Permite al Management Server comunicarse correctamente con la nueva versión"},{"args":"downgrade","description":"Regresa la versión de un VSX Gateway o VSX Cluster a una versión anterior en la base de datos del Management Server. NO realiza el downgrade de software en el hardware, solo actualiza la metadata en la base de datos. Ejecutar DESPUÉS de hacer downgrade del software en el gateway físico. Útil si una actualización falló y fue necesario regresar a versión anterior"},{"args":"reconfigure","description":"Restaura la configuración VSX en un VSX Gateway o miembro de VSX Cluster reenviando toda la configuración desde el Management Server al gateway. Útil cuando: configuración local está corrupta, después de reinstalar OS, cuando fetch no funciona correctamente, o para forzar resincronización completa. Operación que puede tomar tiempo según cantidad de Virtual Systems"},{"args":"view_vs_conf","description":"Muestra y compara la configuración de un Virtual Device entre el Management Server y el VSX Gateway/Cluster. Permite identificar discrepancias entre la configuración teórica (en SMS) y la real (en gateway). Útil para troubleshooting cuando fetch no sincroniza correctamente o para auditoría de configuración. Requiere nombre del VSX object y nombre del Virtual Device"},{"args":"vsls","description":"Muestra menú de configuración interactivo para Virtual System Load Sharing (VSLS). Opciones del menú: ver status de VSLS, redistribuir Virtual Systems entre miembros del cluster, exportar configuración VSLS a archivo, importar configuración VSLS desde archivo. Solo aplicable a VSX Clusters en modo VSLS. Herramienta para balance y migración de VSs entre miembros"}]','vsx','R81+','vsx_util, vsx, management server, cluster, configuración, mantenimiento, vsls, high availability, miembros, interfaces, upgrade, backup','expert','config','management',0,'critical','[]',0,'2025-12-31 11:45:37','2025-12-31 11:45:37');
INSERT INTO checkpoint_commands VALUES(10,'cpconfig','Herramienta interactiva de configuración de CheckPoint que presenta un menú con opciones para configurar aspectos fundamentales del sistema. Permite gestionar licencias, configurar Secure Internal Communication (SIC) con el Management Server, habilitar/deshabilitar membresía en cluster, activar Virtual System Load Sharing (VSLS) en VSX, configurar ClusterXL para modo bridge, ajustar CoreXL y controlar inicio automático de productos CheckPoint. Las opciones mostradas varían según productos instalados y configuración actual. Muchas opciones requieren reinicio del gateway para aplicarse. En entornos de cluster es CRÍTICO configurar todos los miembros de manera idéntica para evitar inconsistencias.','[{"args":"(menú interactivo)","description":"Herramienta de configuración interactiva con menú que presenta opciones según productos instalados. Opciones principales: 1) Licenses and contracts - Gestionar licencias CheckPoint, 2) Secure Internal Communication (SIC) - Configurar/resetear SIC con Management Server, 3) Enable/Disable cluster membership - Activar o desactivar membresía en cluster (requiere reinicio), 4) Enable/Disable Per Virtual System State (VSLS) - Activar o desactivar Virtual System Load Sharing en VSX Cluster (requiere reinicio), 5) Enable/Disable ClusterXL for Bridge - Configurar ClusterXL en modo bridge, 6) Check Point CoreXL - Configurar número de instancias CoreXL (requiere reinicio), 7) Automatic start of Check Point Products - Controlar qué productos inician automáticamente al boot. IMPORTANTE: En clusters, configurar todos los miembros idénticamente"}]','vsx','R81+','cpconfig, configuración, licencias, sic, cluster, vsls, corexl, bridge mode, interactivo, setup','expert','config','firewall',0,'high','[]',0,'2025-12-31 11:45:55','2025-12-31 11:45:55');
INSERT INTO checkpoint_commands VALUES(11,'fwaccel','Comando principal para control y administración de SecureXL, el motor de aceleración de tráfico IPv4 en CheckPoint que mejora dramáticamente el rendimiento del firewall procesando conexiones establecidas en el kernel sin pasar por el firewall inspector. Permite activar/desactivar la aceleración, configurar parámetros de rendimiento, monitorear conexiones aceleradas, gestionar estadísticas, controlar protecciones DoS y SYN Defender, configurar debugging, administrar templates de conexiones y visualizar tablas internas. SecureXL acelera tráfico HTTP, HTTPS, SSH, DNS y otros protocolos una vez que la primera conexión es inspeccionada y aprobada por el firewall.','[{"args":"stat","description":"Muestra el estado actual de SecureXL incluyendo: si está habilitado (enabled) o deshabilitado (disabled), número de instancias SecureXL activas, cantidad de conexiones aceleradas vs no aceleradas, templates activos, protecciones activas (IPS, Application Control, URL Filtering), estado de funcionalidades específicas y path de paquetes (accelerated, F2Fed to firewall). Comando principal para verificar salud y operación de SecureXL. Opciones: -s para resumen corto, -p para mostrar por instancia SecureXL en entornos multi-core"},{"args":"stats","description":"Muestra estadísticas detalladas de aceleración incluyendo: paquetes acelerados vs no acelerados, throughput en pps y Mbps, drop counters por razón (policy drop, connection drop, SYN Defender drops), conexiones por segundo creadas/eliminadas, hits en templates, errores de fragmentación, estadísticas de NAT acelerado, contadores de VPN offload. Usar -s para mostrar delta desde última ejecución. Crítico para troubleshooting de performance y entender por qué tráfico no se acelera"},{"args":"conns","description":"Lista todas las conexiones procesadas por SecureXL con detalles: IPs origen/destino, puertos, protocolo, interfaces, flags de estado (F=forwarded to FW, acelerada, encriptada VPN, con NAT, con QoS, unidireccional/bidireccional), identidad de usuario, instancia SecureXL. Opciones: -f <filtros> para filtrar por tipo conexión (A=con accounting, C=VPN encriptada, N=con NAT, Q=con QoS, U=unidireccional), -s para resumen de total conexiones, -m <número> para limitar cantidad mostrada. ADVERTENCIA: Con muchas conexiones consume mucha memoria y CPU (sk118716)"},{"args":"on","description":"Activa la aceleración SecureXL on-the-fly (al vuelo) si fue previamente deshabilitada. El cambio es temporal y NO sobrevive reinicio. Todas las conexiones existentes se re-evalúan y las que califiquen comienzan a acelerarse. Útil para reactivar después de troubleshooting o testing. Para cambio permanente modificar $FWDIR/boot/modules/fwkern.conf y reiniciar"},{"args":"off","description":"Desactiva la aceleración SecureXL on-the-fly forzando todo el tráfico a pasar por el firewall inspector tradicional. El cambio es temporal y NO sobrevive reinicio. Reduce dramáticamente el throughput pero permite troubleshooting detallado, análisis de paquetes completo y verificar si un problema es causado por SecureXL. Las conexiones aceleradas se transfieren al firewall. Opciones: -s para estadísticas finales antes de desactivar"},{"args":"templates","description":"Muestra los templates (plantillas) de conexión generados por SecureXL. Cada template representa un patrón de tráfico permitido que puede acelerarse sin inspección completa. Incluye: direcciones IP, puertos, protocolo, acción (accept/drop), interfaces, información NAT, referencias a rules del policy. Templates se crean después de que el firewall inspecciona primera conexión. Ver templates ayuda entender qué tráfico se acelera y troubleshoot por qué cierto tráfico no se acelera"},{"args":"dos","description":"Controla Rate Limiting para mitigación DoS en SecureXL. Permite configurar límites de paquetes por segundo (pps) para diferentes tipos de tráfico problemático: SYN floods, UDP floods, ICMP floods, IP fragments. Opciones: -s para mostrar configuración actual y estadísticas de drops por rate limiting, -p <protocolo> para configurar límites específicos. En VSX debe ejecutarse en contexto del Virtual System apropiado. Protege el gateway de ataques de volumen sin afectar tráfico legítimo"},{"args":"synatk","description":"Controla Accelerated SYN Defender, protección contra ataques SYN flood que opera en SecureXL. Monitorea rate de conexiones TCP por destino y activa protección cuando excede threshold configurado. Opciones: stat para ver estado y estadísticas actuales, config para modificar parámetros (threshold, timeout, aggressive mode), clear para resetear estadísticas. Más eficiente que SYN Defender tradicional del firewall porque opera en kernel. Solo protege tráfico que pasa por SecureXL"},{"args":"cfg","description":"Configura parámetros internos de aceleración SecureXL (solo IPv4). Opciones: -a <interface> para excluir interface específica de aceleración, -a reset para acelerar todas las interfaces, -c <número> para límite máximo de conexiones antes de deshabilitar templates, -l <número> para límite máximo de entries en templates database, -m <segundos> para timeout de entries en templates, -p on/off para offload de templates, -i on/off para ignorar API version mismatch. IMPORTANTE: Cambios NO sobreviven reinicio y deben configurarse en todos los miembros del cluster idénticamente"},{"args":"feature","description":"Habilita o deshabilita funcionalidades específicas de SecureXL on-the-fly. Permite control granular de qué características están activas: sync de conexiones en cluster, streaming signatures de IPS, specific features como GTP inspection, urlf (URL Filtering), appi (Application Identification). Sintaxis: -s <feature> on/off para activar/desactivar. Útil para troubleshooting - deshabilitar feature específica para verificar si causa problema. Cambios temporales que NO sobreviven reinicio"},{"args":"dbg","description":"Controla debug de SecureXL para troubleshooting avanzado. Permite activar flags de debug por módulo (default, pkt, vpn, api, db, tmpl, dos, synatk, etc.). Sintaxis: -m <módulo> + <flags> para activar, - <flags> para desactivar, all para activar todos, reset para resetear, list para ver flags activos. Opción -f para filtrar debug por 5-tuple específico (src IP, src port, dst IP, dst port, protocol). Debug genera logs en /var/log/messages. CRÍTICO para diagnosticar por qué conexiones no se aceleran o troubleshoot drops"},{"args":"ranges","description":"Muestra los rangos de direcciones IP cargados en SecureXL que afectan decisiones de aceleración. Incluye: rangos de direcciones para objetos de red, rangos NAT, rangos para VPN domains. SecureXL usa estos rangos para determinar rápidamente si paquete requiere procesamiento especial. Útil para troubleshooting cuando ciertos destinos no se aceleran correctamente o verificar que configuración de network objects se aplicó en SecureXL"},{"args":"tab","description":"Muestra contenido de tablas internas de SecureXL para troubleshooting profundo. Opciones: -t <tabla> para especificar tabla a mostrar. Tablas disponibles incluyen connection table, templates table, dynamic objects table, NAT table, etc. Salida muy técnica con información raw del kernel. Principalmente usado por CheckPoint Support o para debugging muy avanzado de problemas de aceleración o corrupción de tablas"},{"args":"ver","description":"Muestra versión de SecureXL instalada y versión del Firewall. Incluye: build number de SecureXL, versión del kernel SecureXL, versión de CheckPoint Firewall, compatibilidad de API. Útil para verificar versión antes de aplicar hotfixes, comparar versiones entre miembros de cluster, o cuando se reporta bug relacionado con SecureXL a CheckPoint Support"}]','securexl','R81+','securexl, aceleración, performance, rendimiento, templates, conexiones, dos, syn defender, throughput, offload, kernel','expert','query','firewall',1,'medium','[]',0,'2025-12-31 11:54:55','2025-12-31 11:54:55');
INSERT INTO checkpoint_commands VALUES(12,'pdp','Comando principal para control y monitoreo del proceso pdpd (Policy Decision Point) en Identity Awareness. El PDP es el Security Gateway responsable de recolectar y compartir identidades de usuarios y computadoras. Permite monitorear sesiones activas, configurar autenticación y autorización, gestionar Identity Brokers para compartir identidades entre gateways, controlar Identity Collectors, manejar RADIUS accounting, gestionar roles de acceso, configurar nested groups de LDAP, actualizar membresías de grupos, y realizar debugging avanzado. Es componente clave del sistema Identity Awareness que controla acceso de usuarios y protección de red basada en identidad.','[{"args":"monitor","description":"Monitorea el estado de sesiones conectadas al PDP con múltiples filtros disponibles: por IP, usuario, computadora, grupos, tipo de cliente (AD Query, Identity Agent, portal, unknown), versión de cliente, roles, redes, managed assets. Permite ver si sesión fue publicada a PEP gateways. Opciones: all (todas las sesiones), summary (resumen), ip <IP> (por dirección), user <nombre> (por usuario), machine <nombre> (por computadora), groups <grupo> (por grupo), client_type (por tipo autenticación), cv_ge/cv_le (por versión cliente)"},{"args":"debug","description":"Controla debug del PDP en archivo $FWDIR/log/pdpd.elg. Opciones: on/off para activar/desactivar, set <topic> <severity> para filtrar (topics: all o específicos de Support; severities: all, critical, events, important, surprise), reset para resetear opciones, rotate para rotar logs, stat para ver estado actual, spaces <0-5> para indentación, memory para ver consumo memoria, ccc on/off para logs CCC. IMPORTANTE: debug afecta performance del daemon pdpd, desactivar después de troubleshooting. Best practice: pdp debug set all all"},{"args":"control","description":"Provee comandos de control del PDP. Opciones: revoke_ip <IP> para hacer logout de sesión asociada a IP específica, sync para forzar sincronización iniciada entre PDPs y PEPs asegurando que todos tengan información actualizada de sesiones conectadas. Al ejecutar sync, PDP informa a PEPs relacionados sobre información actualizada de todas las sesiones, resultando en que PDP y PEPs contengan la misma información de sesión más reciente"},{"args":"status","description":"Muestra información de estado del PDP incluyendo: hora de inicio (start time), hora de última configuración (configuration time) y otros datos de estado relevantes del proceso pdpd. Útil para verificar cuándo fue iniciado el servicio y cuándo se aplicó la última configuración"},{"args":"connections","description":"Muestra conexiones del PDP con: PEP gateways (Policy Enforcement Points), Terminal Servers y Identity Collectors. Opciones: pep (muestra estado de conexión de todos los PEPs que el PDP actual debe actualizar), ts (lista de Terminal Servers conectados), idc (lista de Identity Collectors conectados). Útil para troubleshooting de problemas de comunicación entre componentes de Identity Awareness"},{"args":"broker","description":"Controla PDP Identity Broker que gestiona compartición de identidades entre PDPs Publisher y Subscriber. Opciones: debug set/unset para logs de Publishers/Subscribers/transporte, discard para timeout de descarte de sesiones durante desconexión, reconnect para forzar reconexión inmediata a Subscriber ignorando keep-alive, status para ver estado de PDPs remotos con -e para info extendida, sync para sincronizar identidades con Publishers/Subscribers o programar sincronización schedule. Crítico para ambientes distribuidos multi-gateway"}]','identity_awareness','R81+','pdp, identity awareness, autenticación, usuarios, sesiones, active directory, ldap, radius, identity collector, roles, grupos, monitoring','expert','query','firewall',1,'medium','[]',0,'2025-12-31 11:59:22','2025-12-31 11:59:22');
INSERT INTO checkpoint_commands VALUES(13,'pep','Comando para control y monitoreo del proceso pepd (Policy Enforcement Point) en Identity Awareness. El PEP es el Security Gateway responsable de hacer cumplir (enforce) restricciones de acceso de red basándose en datos de identidad que recolecta del PDP. Permite visualizar sesiones conocidas por el PEP, verificar comunicación con PDPs, consultar estado de publicación de identidades, troubleshoot problemas de conciliación de sesiones, configurar almacenamiento de información extendida y gestionar tareas del proceso. El PEP toma decisiones de enforcement basadas en identity data del PDP y es componente fundamental para aplicar políticas de seguridad basadas en usuario.','[{"args":"show","description":"Muestra información sobre PEP incluyendo: sesiones que PEP conoce con filtros múltiples (user query permite filtrar por cid/cmp/mchn/mgrp/pdp/role/ugrp/uid/usr usando AND lógico entre filtros), estado de conciliación de sesiones (conciliation_clashes con opciones all/clear/ip), información de red (network con pdp/registration), canal de comunicación PEP-PDP (pdp con all/id), tiempo de inicio de daemon pepd y última recepción de policy (stat), topología de direcciones PDP y PEP (topology_map). Comando principal para troubleshooting de Identity Awareness en gateway enforcement"},{"args":"debug","description":"Controla debug del PEP en archivo $FWDIR/log/pepd.elg. Opciones: on/off para activar/desactivar, set <topic> <severity> para filtrar logs (topics: all o específicos de Support; severities: all, critical, events, important, surprise), reset para resetear configuración debug, rotate para rotar archivos log incrementando índice (pepd.elg -> pepd.elg.0 -> pepd.elg.1), stat para mostrar estado debug actual, spaces 0-5 para indentación en logs, memory para mostrar consumo memoria del daemon pepd. IMPORTANTE: debug afecta performance, desactivar tras troubleshooting. Best practice: pep debug set all all"},{"args":"control","description":"Provee comandos de control del PEP. Opciones: extended_info_storage enable/disable controla si PEP almacena información extendida de identidades para debug, portal_dual_stack enable/disable controla soporte para portal dual stack IPv4 e IPv6, tasks_manager status muestra estado de tareas PEP (running, previous, pending). Útil para configuración y monitoreo operacional del Policy Enforcement Point"},{"args":"tracker","description":"Durante debug de PEP, añade el tópico de debug TRACKER a los logs PEP (habilitado por defecto). Muy útil para monitorear compartición de identidades PDP-a-PEP y otra comunicación en ambientes distribuidos. Opciones: on para habilitar logging de eventos TRACKER en log PEP, off para deshabilitar logging de eventos TRACKER. Se puede configurar manualmente añadiendo tópico TRACKER al debug PEP. Crítico para troubleshooting de sincronización de identidades en arquitecturas multi-gateway"}]','identity_awareness','R81+','pep, identity awareness, enforcement, policy, sesiones, usuarios, pdp, sincronización, identidades, debugging','expert','query','firewall',1,'medium','[]',0,'2025-12-31 11:59:52','2025-12-31 11:59:52');
INSERT INTO checkpoint_commands VALUES(14,'adlog','Comando para control y monitoreo del proceso ADLOG responsable de adquisición de identidades de usuarios y computadoras desde Active Directory. El adlog corre en Security Gateway cuando AD Query está habilitado (sirve a Identity Awareness blade que hace enforcement y logging de identidades) o en Log Server para logging de identidades. Permite controlar estados de usuarios, consultar base de datos de identidades capturadas, gestionar Multi-User Hosts, administrar service accounts, verificar conectividad con domain controllers, troubleshoot mediante debug y obtener estadísticas de eventos procesados. Herramienta fundamental para monitoreo y troubleshooting de adquisición de identidades basada en Active Directory.','[{"args":"control","description":"Envía comandos de control al AD Query. Opciones: muh (gestiona Multi-User Hosts con show/mark/unmark para IPs), reconf (reconfigura AD Query reseteando configuración de policy a la definida en SmartConsole), srv_accounts (gestiona service accounts que son cuentas de servicios no usuarios reales, con show/clear/find/unmark; service accounts son sospechosos si login más de cierto número de veces), stop (detiene AD Query y gateway deja de adquirir identidades). Crítico para administración operacional de adquisición de identidades desde Active Directory"},{"args":"dc","description":"Muestra estado de conexión al domain controller de Active Directory. Permite verificar conectividad entre Security Gateway y AD DC. Sintaxis: adlog a dc (cuando adlog corre en Security Gateway para Identity Awareness) o adlog l dc (cuando adlog corre en Log Server para Identity Logging). Útil para troubleshooting rápido de problemas de comunicación con Active Directory"},{"args":"debug","description":"Habilita y deshabilita salida de debug del adlog. Output de debug va a: $FWDIR/log/pdpd.elg (Identity Awareness en Security Gateway) o $FWDIR/log/fwd.elg (Identity Logging en Log Server). Opciones: on activa debug, off desactiva debug, mode muestra estado actual (on/off), extended activa debug con tópicos extendidos adicionales. Crítico para troubleshooting de problemas de adquisición de identidades desde eventos de Active Directory"},{"args":"query","description":"Muestra base de datos de identidades adquiridas por AD Query según filtro especificado. Permite consultar identidades capturadas desde Active Directory. Opciones: all (sin filtro, muestra base completa), ip <IP> (filtra identidades relacionadas a IP específica), machine <nombre> (filtra por nombre computadora), string <texto> (filtra por cadena texto), user <username> (filtra por usuario específico). Fundamental para verificar qué identidades ha capturado el gateway y troubleshoot problemas de mapeo IP-usuario"},{"args":"statistics","description":"Muestra estadísticas sobre NT Event logs recibidos por adlog para cada dirección IP y total general. También muestra número de direcciones IP identificadas. Permite entender volumen de eventos procesados desde Active Directory y cuántas IPs únicas tienen identidades asignadas. Útil para monitoreo de salud del AD Query y capacidad de procesamiento de eventos"}]','identity_awareness','R81+','adlog, ad query, active directory, identidades, usuarios, domain controller, eventos, multi-user hosts, service accounts, logging','expert','query','firewall',1,'medium','[]',0,'2025-12-31 12:00:22','2025-12-31 12:00:22');
INSERT INTO checkpoint_commands VALUES(15,'test_ad_connectivity','Utilidad para ejecutar pruebas de conectividad desde Security Gateway hacia domain controller de Active Directory. Verifica conectividad LDAP (Lightweight Directory Access Protocol) y WMI (Windows Management Instrumentation) que son protocolos esenciales para Identity Awareness. Permite diagnosticar problemas de comunicación con AD antes de configurar Identity Awareness. Soporta IPv4 e IPv6, LDAP y LDAPS (SSL), configuración de timeouts, y testing selectivo de solo LDAP o solo WMI. Parámetros pueden especificarse en línea de comandos o en archivo de configuración $FWDIR/conf/test_ad_connectivity.conf. Salida se guarda en archivo especificado en $FWDIR/tmp/ y también genera log en $FWDIR/log/test_ad_connectivity.elg. Crítico para troubleshooting de prerequisitos de Identity Awareness.','[{"args":"-i <IP> -d <domain> -u <user> -c <password> -o <output>","description":"Ejecuta pruebas de conectividad LDAP y WMI desde Security Gateway hacia domain controller de AD especificado por IPv4. Parámetros obligatorios: -i IP del DC, -d nombre dominio AD, -u username administrador AD, password (con -c texto claro, -p ofuscado o -a prompt), -o nombre archivo salida en $FWDIR/tmp/. Opcionales: -b LDAP search base, -D user DN, -f AD fingerprint para LDAPS, -l solo test LDAP, -w solo test WMI, -s LDAP sobre SSL, -r puerto (389 LDAP/636 LDAPS), -L timeout LDAP, -t timeout total. Salida muestra status: SUCCESS_LDAP_WMI, LDAP_SUCCESS, WMI_SUCCESS con timestamp"},{"args":"-I <IPv6> -d <domain> -u <user> -c <password> -o <output>","description":"Ejecuta pruebas de conectividad LDAP y WMI desde Security Gateway hacia domain controller de AD especificado por IPv6. Funcionalidad idéntica a versión IPv4 pero usando dirección IPv6 del domain controller. Parámetros y opciones iguales excepto -I en lugar de -i. Permite testing de conectividad AD en ambientes dual-stack o IPv6-only"},{"args":"-h","description":"Muestra ayuda integrada del comando mostrando sintaxis, parámetros disponibles y ejemplos de uso. Útil para referencia rápida de opciones sin consultar documentación"}]','identity_awareness','R81+','test_ad_connectivity, active directory, ldap, wmi, conectividad, domain controller, troubleshooting, identity awareness, testing','expert','utility','firewall',0,'low','[]',0,'2025-12-31 12:00:46','2025-12-31 12:00:46');
